import React from "react";
import "./Example.scss";

export default function Example() {
  return (
    <div>
      <p>Example</p>
      <p className="font">Example</p>
      <nav>
        <ul>
          <li>123</li>
        </ul>
      </nav>
      <ul>
        <li>
          <a>456</a>
        </li>
      </ul>
      <p className="base">Hello,</p>
    </div>
  );
}
